            "created": 1451935931000, 
            "description": "<p>Comcast Labs DC is hosting a screening of a powerful documentary film. <b>CODE: Debugging the Gender Gap</b> exposes the lack of female and minority software engineers and explores the reasons for this gap, highlighting breakthrough efforts that are producing more diverse programmers. CODE asks: what would society gain from having more women and minorities code and how do we get there?\u00a0</p> <p>Click <a href=\"http://www.codedoc.co/about/\" class=\"linkified\">http://www.codedoc.co/about/</a> to view the trailer, and if you\u2019re intrigued, <b>please RSVP</b> to reserve a spot.\u00a0<b>Light refreshments will be served</b></p> <p>Hope to see you there!</p> <p>Navdeep Martin<br/>Senior Product Manager<br/>Comcast Labs DC</p>", 
