            "created": 1451357840000, 
            "description": "<p><img src=\"http://photos2.meetupstatic.com/photos/event/4/d/6/c/600_445459820.jpeg\" /></p> <p><b>ISOC-DC</b> and<b> DC Legal Hackers</b> proudly present: <b>\"Hacking Accountability in Internet Governance\"</b></p> <p><br/>This event will reflect on the accountability discussions that has been occurring with respect to the IANA transition to discuss internet accountability in general. This salon-style session will use the IANA accountability debate to try to create 10,000-foot solutions.</p> <p>Speakers:</p> <p><b>\u2022\u00a0<i>Steve del Bianco,</i> NetCoalition</b></p> <p><b>\u2022\u00a0<i>Christian Dawson</i>, I2C</b></p> <p>\u2022 <i>More to TBD\u00a0</i></p> <p>Schedule:</p> <p><br/>6:00pm: Drinks/Networking</p> <p>6:45pm: Announcements\u00a0</p> <p>7:00pm: Panel Introductions\u00a0</p> <p>7:15pm: Panel</p> <p>8:00pm: Q&amp;A</p> <p>8:30pm: Fin</p> <p>-----</p> <p><br/>DC Legal Hackers is the DC Chapter of a growing movement of<a href=\"https://legalinformatics.wordpress.com/2013/09/12/legal-hacking-technology-and-innovation-groups/\">\u00a0more than twenty</a>\u00a0legal hacking, technology, or innovation groups around the world.</p> <p>A legal hacker is someone who cares about the intersection of law and technology and seeks to improve legal practice through technology while simultaneously using legal skills to promote technological innovation and exploration.</p> <p>#LegalHack\u00a0</p>", 
